import React from 'react';

function PracticeTodo(){
    const arr = [1,2,3,4,5];
  return(
    <div>
      <h2>Basic of React js</h2>
      <ul>
      {
        arr.map((val,i)=>{
          return(
              < div key={i}>
              <h2 >Value {val}</h2>
              <h3>Index {i}</h3>
              </div>
          )
        })
      }
        <li></li>
      </ul>
      
    </div>
  )
}

export default PracticeTodo
